import React, { useState, useMemo } from 'react';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
  ReferenceLine,
} from 'recharts';

const mockData = [
  {
    timestamp: '2024-09-20T23:52:27',
    event_type: 'glucose',
    glucose_value: 171,
  },
  {
    timestamp: '2024-09-20T23:57:27',
    event_type: 'glucose',
    glucose_value: 157,
  },
  {
    timestamp: '2024-09-21T00:02:28',
    event_type: 'glucose',
    glucose_value: 153,
  },
  {
    timestamp: '2024-09-21T00:07:28',
    event_type: 'glucose',
    glucose_value: 152,
  },
  {
    timestamp: '2024-09-21T00:12:28',
    event_type: 'glucose',
    glucose_value: 154,
  },
  {
    timestamp: '2024-09-21T00:17:28',
    event_type: 'glucose',
    glucose_value: 159,
  },
  {
    timestamp: '2024-09-21T00:22:27',
    event_type: 'glucose',
    glucose_value: 151,
  },
  {
    timestamp: '2024-09-21T00:27:28',
    event_type: 'glucose',
    glucose_value: 143,
  },
  {
    timestamp: '2024-09-21T00:32:27',
    event_type: 'glucose',
    glucose_value: 144,
  },
  {
    timestamp: '2024-09-21T00:37:27',
    event_type: 'glucose',
    glucose_value: 156,
  },
  {
    timestamp: '2024-09-21T00:42:27',
    event_type: 'glucose',
    glucose_value: 168,
  },
  {
    timestamp: '2024-09-21T00:47:28',
    event_type: 'glucose',
    glucose_value: 178,
  },
  {
    timestamp: '2024-09-21T00:52:28',
    event_type: 'glucose',
    glucose_value: 184,
  },
  {
    timestamp: '2024-09-21T00:57:28',
    event_type: 'glucose',
    glucose_value: 192,
  },
  {
    timestamp: '2024-09-21T01:02:27',
    event_type: 'glucose',
    glucose_value: 199,
  },
  {
    timestamp: '2024-09-21T01:07:27',
    event_type: 'glucose',
    glucose_value: 207,
  },
  {
    timestamp: '2024-09-21T01:12:28',
    event_type: 'glucose',
    glucose_value: 210,
  },
  {
    timestamp: '2024-09-21T01:17:28',
    event_type: 'glucose',
    glucose_value: 211,
  },
  {
    timestamp: '2024-09-21T01:22:28',
    event_type: 'glucose',
    glucose_value: 213,
  },
  {
    timestamp: '2024-09-21T01:27:28',
    event_type: 'glucose',
    glucose_value: 211,
  },
];

const Dashboard = () => {
  const [timeRange, setTimeRange] = useState(24); // Ensure this is initialized

  const filteredData = useMemo(() => {
    const now = new Date();
    const cutoff = new Date(now.getTime() - timeRange * 60 * 60 * 1000);
    return mockData
      .filter(
        (item) => new Date(item.timestamp) > cutoff // Use timestamp from mockData
      )
      .map((item) => ({
        date: item.timestamp.split('T')[0], // Extract date
        time: item.timestamp.split('T')[1], // Extract time
        bloodSugar: item.glucose_value, // Use glucose_value for blood sugar
        type: 'Glucose', // Set a static type for display
        description: 'Glucose measurement', // Set a static description for display
      }));
  }, [timeRange]); // Ensure timeRange is in the dependency array

  const timeRangeButtons = [
    { label: '1 hr', value: 1 },
    { label: '3 hr', value: 3 },
    { label: '6 hr', value: 6 },
    { label: '12 hr', value: 12 },
    { label: '24 hr', value: 24 },
  ];

  return (
    <div className="mx-auto p-4 bg-gray-100">
      <h2 className="text-2xl font-bold mb-4">Health Dashboard</h2>

      <div className="flex flex-col md:flex-row">
        {' '}
        {/* Use flex-col for small screens and flex-row for medium and up */}
        <div className="flex-1 mb-4 md:mb-0">
          {' '}
          {/* Flex-grow for left side */}
          <div className="p-4 rounded-lg shadow mb-4">
            <div className="flex justify-between mb-2">
              {timeRangeButtons.map((button) => (
                <button
                  key={button.value}
                  onClick={() => setTimeRange(button.value)} // Ensure this is correctly set
                  className={`px-2 py-1 rounded ${
                    timeRange === button.value
                      ? 'bg-blue-500 text-white'
                      : 'text-blue-500'
                  }`}
                >
                  {button.label}
                </button>
              ))}
            </div>

            <h3 className="text-lg font-semibold mb-2 text-left">
              Blood Sugar
            </h3>

            <ResponsiveContainer width="100%" height={200}>
              <LineChart data={filteredData}>
                <XAxis dataKey="time" />
                <YAxis domain={[0, 300]} />
                <Tooltip />
                <ReferenceLine y={250} stroke="#ffd700" strokeDasharray="3 3" />
                <ReferenceLine y={70} stroke="#ff0000" strokeDasharray="3 3" />
                <Line
                  type="monotone"
                  dataKey="bloodSugar"
                  stroke="#3b82f6"
                  strokeWidth={2}
                />
              </LineChart>
            </ResponsiveContainer>
          </div>
          <div className="bg-white p-4 rounded-lg shadow">
            <h3 className="font-semibold mb-2">Events</h3>
            <div className="overflow-x-auto">
              <table className="min-w-full">
                <thead>
                  <tr className="bg-gray-100">
                    <th className="py-2 px-4 text-left">Date</th>
                    <th className="py-2 px-4 text-left">Time</th>
                    <th className="py-2 px-4 text-left">Blood Sugar</th>
                    <th className="py-2 px-4 text-left">Type</th>
                    <th className="py-2 px-4 text-left">Description</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredData.map((event, index) => (
                    <tr
                      key={index}
                      className={index % 2 === 0 ? 'bg-gray-50' : 'bg-white'}
                    >
                      <td className="py-2 px-4">{event.date}</td>
                      <td className="py-2 px-4">{event.time}</td>
                      <td className="py-2 px-4">{event.bloodSugar} mg/dL</td>
                      <td className="py-2 px-4">{event.type}</td>
                      <td className="py-2 px-4">{event.description}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
        <div className="flex-none w-full md:w-1/2 p-4">
          {/* Full width on small screens, half on medium and up */}
          <iframe
            src="https://gpt4o.so/tools/i/healthy-chef-ZxWya7Xx"
            width="100%" // Make iframe responsive
            height="500"
            style={{ maxWidth: '100%' }}
            title="Healthy Chef Tool"
          ></iframe>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
